import "./footer.scss"

export default function Footer() {
  return (
    <div className="footer" id="footer">

        <div className="wrapper">
          <div className="text-about">
               <p>I’m a Stockholm based frontend developer with graphic design experience, often from working in close collaboration with clients. The last few years I’ve shifted from graphic design towards web development which I’ve become rather passionate about. I’m drawn to working with data structures, developing playful visual aesthetics and creating intuitive functionality.

               </p>
          </div>
        </div>

    </div>
  )
}
